import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { ActivityIndicator, FlatList, StyleSheet, TouchableOpacity, Image, View } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  common: {
    paddingTop: 50
  },
  logo: {
    width: 300,
    height:  200
  },
  indicator: {
    paddingTop: 50
  }
});

const data = [
  {str: 'Rei Mizobuchi', key: 'boy'},
  {str: 'Nanami Tomatsu', key: 'girl'},
];

export default function App() {

  return (
    <View style={styles.container}>
      <TouchableOpacity onPress={() => console.warn('pressed!')}>
        <Image style={styles.logo}source={require('./assets/react-native-logo.png')}/>
      </TouchableOpacity>
      <View style={styles.indicator}>
        <ActivityIndicator/>
      </View>
      <FlatList data={this.data} renderItem={({item}) => {
        return <Text key={item.key}>{item.str}</Text>
      }}
      />
    </View>
  );
}
